import { createWebHistory, createRouter } from "vue-router";

const routes = [
    {
      path : "/",
      name : 'tutorials',
      component: () => import ("/Users/semayuceuluc/Downloads/TechCarrer/vue-crud-ornek/src/components/TutorialsList.vue")
    },
    {
        path : "/ekle",
        name : "ekle",
        component: () => import ("/Users/semayuceuluc/Downloads/TechCarrer/vue-crud-ornek/src/components/AddTutorial.vue")
    },
    {
        path : "/tutorial/:id",
        name : "tutorial-detail",
        component: () => import ("/Users/semayuceuluc/Downloads/TechCarrer/vue-crud-ornek/src/components/TutorialDetail.vue")
    },
]

const router = createRouter ({
    history : createWebHistory(),
    routes
});
export default router;
